import { useLoaderData } from "react-router-dom";
function Libros(){
    let _libros = useLoaderData();
    return (
        <div>
          {_libros.map((libro) => (
            <div key={libro._id}>
              <h3>{libro.Titulo}</h3>
              <p>{libro.Autor}</p>
              <p>{libro.Precio}</p>
            </div>
          ))}
        </div>
      );
}
export default Libros;
